import React from 'react'

function Category( { categories }) {
  return (
    <div>
        {
            categories.map(category => {
                return(
                    <div>
                        <button onClick={handleClick}>{category}</button>
                    </div>
                )
            })
        }
    </div>
  )
}

export default Category
